$username = "root";
$password = "";
$dbname = "laptop";

$conn = new mysqli($servername, $username, $password, $dbname);

if ($conn->connect_error) {
    die("Koneksi gagal: " . $conn->connect_error);
}

// Query untuk mengambil data toko beserta lokasi
$query = "SELECT toko.id_toko,galeri.foto,toko.nama_toko, toko.alamat, toko.no_telpon, toko.jam_operasional, 
                 toko.kategori_produk, toko.mark_tersedia, toko.rating, toko.layanan_ekstra, 
                 toko.status_aktif, lokasi.lat, lokasi.lng 
          FROM lokasi 
          JOIN toko ON lokasi.id_lokasi = toko.id_lokasi
          JOIN galeri ON toko.id_galeri = galeri.id_galeri";
$result = $conn->query($query);

$markers = [];
if ($result && $result->num_rows > 0) {
    while ($row = $result->fetch_assoc()) {
        $markers[] = $row;
    }
} else {
    echo "Tidak ada data yang ditemukan.";
}

// Encode data menjadi JSON
echo "<script>const markersData = " . json_encode($markers) . ";</script>";

// Ambil data pencarian
$storeName = $_GET['store_name'] ?? '';

$singleMarkerData = null;
if (!empty($storeName)) {
    $query = "
        SELECT t.id_toko, t.nama_toko, t.alamat, t.no_telpon, t.jam_operasional, t.kategori_produk, 
               t.mark_tersedia, t.rating, t.layanan_ekstra, t.status_aktif, l.lat, l.lng, g.foto
        FROM toko t
        JOIN lokasi l ON t.id_lokasi = l.id_lokasi
        JOIN galeri g ON t.id_galeri = g.id_galeri
        WHERE t.nama_toko LIKE ?
        LIMIT 1
    ";
    $stmt = $conn->prepare($query);
    $searchTerm = '%' . $storeName . '%';
    $stmt->bind_param('s', $searchTerm);
    $stmt->execute();
    $result = $stmt->get_result();

    if ($row = $result->fetch_assoc()) {
        $singleMarkerData = $row;
    }

    $stmt->close();
}
