    <script>
// Mengecek apakah geolocation tersedia di browser
if (navigator.geolocation) {
    // Mendapatkan lokasi pengguna setelah peta dimuat
    navigator.geolocation.getCurrentPosition(function(position) {
        const userLat = position.coords.latitude;  // Latitude pengguna
        const userLng = position.coords.longitude; // Longitude pengguna

        // Tampilkan peta berdasarkan lokasi pengguna terlebih dahulu
        const map = L.map('map').setView([userLat, userLng], 13);

        // Tambahkan tile layer untuk peta
        L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
            attribution: '© OpenStreetMap contributors'
        }).addTo(map);

        <?php foreach ($polygons as $key => $geojson): ?>
            const <?= $key ?> = <?= json_encode($geojson) ?>;
        <?php endforeach; ?>

        // Menambahkan polygon ke peta
        const geojsonLayers = [
            { data: polygonJSON1, style: { fillColor: 'blue', fillOpacity: 0.2, color: 'blue', weight: 1, opacity: 1 } },
            { data: polygonJSON2, style: { fillColor: 'red', fillOpacity: 0.2, color: 'blue', weight: 1, opacity: 1 } },
            { data: polygonJSON3, style: { fillColor: 'yellow', fillOpacity: 0.2, color: 'blue', weight: 1, opacity: 1 } },
            { data: polygonJSON4, style: { fillColor: 'green', fillOpacity: 0.2, color: 'blue', weight: 1, opacity: 1 } },
            { data: polygonJSON5, style: { fillColor: 'purple', fillOpacity: 0.2, color: 'blue', weight: 1, opacity: 1 } },
            { data: polygonJSON6, style: { fillColor: 'pink', fillOpacity: 0.2, color: 'blue', weight: 1, opacity: 1 } }
        ];

        geojsonLayers.forEach(({ data, style }) => {
            L.geoJson(data, { style }).addTo(map);
        });

        // Membuat ikon marker biru untuk titik lokasi awal dan akhir
        const blueIcon = L.icon({
            iconUrl: 'map1.png',
            shadowUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-shadow.png',
            iconSize: [25, 41],
            iconAnchor: [12, 41],
            popupAnchor: [1, -34],
            shadowSize: [41, 41]
        });

        // Membuat ikon marker merah untuk toko
        const redIcon = L.icon({
            iconUrl: 'map.png',
            shadowUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-shadow.png',
            iconSize: [25, 41],
            iconAnchor: [12, 41],
            popupAnchor: [1, -34],
            shadowSize: [41, 41]
        });

        <?php
// Koneksi ke database
$conn = new mysqli('localhost', 'root', '', 'laptop');

// Periksa koneksi
if ($conn->connect_error) {
    die("Koneksi gagal: " . $conn->connect_error);
}

// Ambil data toko dari database
$sql = "SELECT t.id_toko, t.nama_toko, t.alamat, t.no_telpon, t.jam_operasional, t.kategori_produk, 
               t.mark_tersedia, t.rating, t.layanan_ekstra, t.status_aktif, l.lat, l.lng, g.foto
        FROM toko t
        JOIN lokasi l ON t.id_lokasi = l.id_lokasi
        JOIN galeri g ON t.id_galeri = g.id_galeri";
$result = $conn->query($sql);

$stores = []; // Menyimpan data toko

if ($result->num_rows > 0) {
    // Menambahkan setiap baris data toko ke array
    while($row = $result->fetch_assoc()) {
        $stores[] = $row;
    }
} else {
    echo "Tidak ada toko ditemukan.";
}

// Tutup koneksi
$conn->close();
?>

        // Menambahkan marker toko dari database
        <?php foreach ($stores as $index => $store): ?>
    // Menyusun data untuk setiap toko
    const storeData<?= $index ?> = <?= json_encode($store) ?>;

    // Menyusun konten popup untuk setiap toko dengan variabel unik
    const popupContent<?= $index ?> = `
        <strong>${storeData<?= $index ?>.nama_toko}</strong><br>
        <em>${storeData<?= $index ?>.alamat}</em><br>
        No. Telpon: ${storeData<?= $index ?>.no_telpon}<br>
        Jam Operasional: ${storeData<?= $index ?>.jam_operasional}<br>
        Kategori Produk: ${storeData<?= $index ?>.kategori_produk}<br>
        Rating: ${storeData<?= $index ?>.rating}<br>
        Layanan Ekstra: ${storeData<?= $index ?>.layanan_ekstra}<br>
        Status Aktif: ${storeData<?= $index ?>.status_aktif}<br>
        Foto: <img src="admin/${storeData<?= $index ?>.foto}" alt="Gambar dari galeri" height="150" width="150">
        <a href="detail.php?id_toko=${storeData<?= $index ?>.id_toko}" class="detail-button">Lihat Detail</a>

         
    `

    // Menambahkan marker toko ke peta
    const storeMarker<?= $index ?> = L.marker([storeData<?= $index ?>.lat, storeData<?= $index ?>.lng, { icon: redIcon }])
        .bindPopup(popupContent<?= $index ?>)  // Menggunakan variabel popupContent yang unik
        .addTo(map);
<?php endforeach; ?>

        // Menambahkan marker untuk lokasi pengguna
        L.marker([userLat, userLng], { icon: redIcon })
            .bindPopup('Lokasi Anda')
            .addTo(map);

        // Jika ada marker tunggal yang disarankan
        const singleMarkerData = <?= json_encode($singleMarkerData) ?>;

        if (singleMarkerData) {
            const { lat, lng, nama_toko, alamat, no_telpon, jam_operasional, kategori_produk, rating, layanan_ekstra, status_aktif, foto, id_toko } = singleMarkerData;

            // Geser peta ke lokasi toko
            map.setView([lat, lng], 15);

            // Menambahkan marker untuk lokasi tujuan
            L.marker([lat, lng], { icon: blueIcon })
                .bindPopup(`
                    <strong>${nama_toko}</strong><br>
                    <em>${alamat}</em><br>
                    No. Telpon: ${no_telpon}<br>
                    Jam Operasional: ${jam_operasional}<br>
                    Kategori Produk: ${kategori_produk}<br>
                    Rating: ${rating}<br>
                    Layanan Ekstra: ${layanan_ekstra}<br>
                    Status Aktif: ${status_aktif}<br>
                    Foto: <img src="admin/${foto}" alt="Gambar dari galeri" height="150" width="150">
                    <a href="detail.php?id_toko=${id_toko}" class="detail-button">Lihat Detail</a>

                `)
                .addTo(map)
                .openPopup();

            // Menambahkan rute dari lokasi pengguna ke toko
            L.Routing.control({
                waypoints: [
                    L.latLng(userLat, userLng), // Titik awal (lokasi pengguna)
                    L.latLng(lat, lng)         // Titik tujuan (lokasi toko)
                ],
                routeWhileDragging: true,
                lineOptions: {
                    styles: [{ color: 'black', weight: 3, dashArray: '5, 10' }] // Garis hitam putus-putus
                },
                createMarker: function() { return null; } // Tidak menambahkan marker default di rute
            }).addTo(map);
        }
    });
}
